MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "CalibreDefectReview, part of the Calibre tool suite, provides efficient analysis, classification, and trend analysis of defects identified by mask inspection systems. The software includes features for easy and fast defect navigation, visual display, defect selection and filtering, defect classification, clustering, sophisticated CD analysis, analysis over multiple inspections, and repeatability and trend analysis. ");
MGCAddSnippet(5, "The Calibre DefectReview mask inspection analyzer can be installed on different supported hosts.");
MGCAddSnippet(6, "You can install Calibre DefectReview on Microsoft Windows hosts. ");
MGCAddSnippet(7, "There are two methods of licensing: floating and node-locked. Floating licenses are a pool of shared licenses available from a licensing server. With node-locked licensing, licenses are assigned to specific machines.");
MGCAddSnippet(8, "Prior to installing any node-locked or floating license (.lic) file, you must first enter the PC host names in the license file.");
MGCAddSnippet(9, "With the floating licensing scheme, a pool of shared licenses are available from a licensing server.");
MGCAddSnippet(10, "Calibre DefectReview supports a floating license manager on Windows hosts. ");
MGCAddSnippet(11, "Once the license manager for floating licenses is invoked, the machines that are on the same network as the server machine can use it by setting the LM_LICENSE_FILE environment variable.");
MGCAddSnippet(12, "In this scenario, Calibre DefectReview can run in stand-alone mode, which means that your machine need not be on the network. Here, a license file is given to each host. ");
MGCAddSnippet(13, "On each machine to receive a node-locked license, you must add the LM_LICENSE_FILE environment variable and point it to the host name on which the license server is running");
MGCAddSnippet(14, "In this scenario, there is a pool of node-locked licenses. This requires that the license server be installed.");
MGCAddSnippet(15, "When setting up for a group of node-locked licenses, you must first set up a license server.");
MGCAddSnippet(16, "On each machine to receive a node-locked license, you must add the LM_LICENSE_FILE environment variable and point it to the host name of on which the license server is running.");
MGCAddSnippet(17, "You can specify an idle time after which Calibre DefectReview releases its license. This is also known as a timeout.");
MGCAddSnippet(18, "You can customize the license file on Windows hosts to restrict usage of certain Calibre DefectReview sub-tools by removing corresponding license features from the license file.");
MGCAddSnippet(19, "The installation for Calibre DefectReview includes Calibre self-extracting software (_mib.exe file). This bundle installs the MGC_HOME tree and the docs directory into your current directory by default. Therefore, if you have downloaded the compressed executable files to, for example, $HOME/my_downloads, but want to install the tree under /user/mgc, you must cd to /user/mgc.");
MGCAddSnippet(20, "To begin using Calibre DefectReview on Microsoft Windows hosts, invoke the Calibre DefectReview executable and then log in.");
MGCAddSnippet(21, "To begin using Calibre DefectReview on Linux hosts, invoke the Calibre DefectReview executable and then log in.");
MGCAddSnippet(22, "Calibre DefectReview allows you to import your user configurations from a previous version.");
MGCAddSnippet(23, "After you login to Calibre DefectReview for the first time, a configuration file called dat-ini.xml is created in your HOME directory. The location of this file is $HOME/.calibrenx_workspace/. ");
MGCAddSnippet(24, "There are three user permission levels, also referred to as user types, that control the availability of features in Calibre DefectReview: privileged, normal, and restricted. ");
MGCAddSnippet(25, "You can configure menu items under the Utilities and Settings menus for normal and restricted user types in Calibre DefectReview s dat-ini.xml file. This is set using the UserFeatureControl entry in the datInfo node of the dat-ini.xml file.");
MGCAddSnippet(26, "After logging in as a privileged account, there are a number of operations that allow you to manage user access to Calibre DefectReview features.");
MGCAddSnippet(27, "You can add a new user to Calibre DefectReview through the Utilities menu.");
MGCAddSnippet(28, "You can delete an existing user account from Calibre DefectReview.");
MGCAddSnippet(29, "You can change a Calibre DefectReview user password in the Utilities menu.");
MGCAddSnippet(30, "There are three user types: privileged, normal, and restricted. There are additional restrictions that apply when performing user management tasks.");
MGCAddSnippet(31, "Calibre DefectReview uses an inspection file as the primary means of collecting and tracking defect information. ");
MGCAddSnippet(32, "You can open inspection files from the File menu of Calibre DefectReview.");
MGCAddSnippet(33, "You can also open recently opened files from the File menu.");
MGCAddSnippet(34, "There are a number of methods available to search for and open inspection files using Calibre DefectReview.");
MGCAddSnippet(35, "Use the Search and Open Inspection(s) dialog box to set up parameters for your search for inspection files.");
MGCAddSnippet(36, "You can set the search utility to search based on the file creation date.");
MGCAddSnippet(37, "You can set the search utility to search based on modification date.");
MGCAddSnippet(38, "You can set the search utility to search based a range of file sizes in kilobytes (KBs).");
MGCAddSnippet(39, "After setting all desired search criteria in the Search And Open Inspection(s) dialog box, you can begin searching for your inspection file.");
MGCAddSnippet(40, "You can further refine your results using Search Options.");
MGCAddSnippet(41, "You can save your inspection file search results in Calibre DefectReview.");
MGCAddSnippet(42, "Calibre DefectReview supports alternative inspection reports that you can load into the tool.");
MGCAddSnippet(43, "Calibre DefectReview supports loading of KLA-Tencor s Klarf v1.2 inspection report files.");
MGCAddSnippet(44, "Calibre DefectReview records all changes done in a Klarf file when the inspection file is saved.");
MGCAddSnippet(45, "Calibre DefectReview supports loading of Lasertec inspection reports. It currently supports X700 and X800 file formats. The LRF inspection report supports the TransRef Mode for improved analysis.");
MGCAddSnippet(46, "Calibre DefectReview supports loading of NuFlare s XML inspection report files.");
MGCAddSnippet(47, "Calibre DefectReview supports loading of Lasertec s LDF inspection report files.");
MGCAddSnippet(48, "Auxiliary files contain extra review information created by Calibre DefectReview. All supported formats create an auxiliary file when the inspection report is saved. They are also created during a Save As operation.");
MGCAddSnippet(49, "By default, many types of inspection reports (such as LRF and Nuflare) can have issues when aligning images, which can make the process of finding differences between the defect and reference images cumbersome. To overcome this, Calibre DefectReview performs automatic alignment of defect and reference images during the load time of the inspection report, as well as zooming in and centering the defect location. Calibre DefectReview also maintains a cache of these registered images to speed up the load time for subsequent sessions.");
MGCAddSnippet(50, "A reticle information file (RIF) contains supplemental information about a reticle and inspections that are not captured in an inspection report or auxiliary files (including mask unique ID, mask type, blank mask ID, layout or job deck file name, reticle resist tone, CD image coordinates, wafer scanner parameters).");
MGCAddSnippet(51, "Inspection files can be searched and opened from the Calibre DefectReview window by entering a search string in the Search toolbar.");
MGCAddSnippet(52, "You can open inspection files stored in the database from the File menu of Calibre DefectReview.");
MGCAddSnippet(53, "You can use two different methods to save a inspection file.");
MGCAddSnippet(54, "You can change the default save location for your inspection file.");
MGCAddSnippet(55, "The toolbar of Calibre DefectReview displays the current defect information. ");
MGCAddSnippet(56, "Commands documented in this manual utilize particular syntax conventions.");
MGCAddSnippet(57, "The Calibre DefectReview main window contains a number of functional regions for defect analysis and classification.");
MGCAddSnippet(58, "The Calibre DefectReview interface is organized into several key functional regions. ");
MGCAddSnippet(59, "All windows in the main display of Calibre DefectReview are  dockable.  Dockable windows allow you to modify the GUI layout by arranging the windows based on your desired configuration. ");
MGCAddSnippet(60, "There are a number of operations in Calibre DefectReview that enable you to work with multiple inspection files.");
MGCAddSnippet(61, "You can use Calibre DefectReview to open multiple inspection files.");
MGCAddSnippet(62, "You can access recently opened inspection files from the Calibre DefectReview window.");
MGCAddSnippet(63, "You can use Calibre DefectReview to open multiple inspection files from the database.");
MGCAddSnippet(64, "When opening multiple inspection files, Calibre DefectReview loads each inspection file in folders, which are accessed with numbered buttons. The buttons are also referred to as folders. ");
MGCAddSnippet(65, "This chapter describes the operations that can be performed using the Defect Map window in Calibre DefectReview.");
MGCAddSnippet(66, "The Defect Map window provides a graphical view of all the defects detected from an inspection. It also provides the option to navigate and edit defects. ");
MGCAddSnippet(67, "The Defect Map window supports a number of operations that enable you to visually analyze the results of an inspection.");
MGCAddSnippet(68, "Aside from the zoom controls available in the toolbar, there are additional methods to adjust your view in the Defect Map window.");
MGCAddSnippet(69, "You can overlay the die cycle or the reticle image (or both) on the Defect Map. ");
MGCAddSnippet(70, "Show Origin (the green plus icon) toggles the display of the origin on the Defect Map window. ");
MGCAddSnippet(71, "Show Classification Label (the green L icon) controls the display of defect information. The defect information includes the defect ID, classification code, and Primary Classification comments (if present) for all defects in the Defect Map window.");
MGCAddSnippet(72, "You can configure the units used to display the coordinates as either microns or millimeters using the dat-ini.xml file. ");
MGCAddSnippet(73, "Calibre DefectReview supports a selection mode known as  rubber band  selection.");
MGCAddSnippet(74, "In Calibre DefectReview, you can select defects by dragging a box around them using your mouse.");
MGCAddSnippet(75, "The RubberBand Selection menu item can be deactivated for normal and restricted user types only.");
MGCAddSnippet(76, "Distances between defects can be measured using the Ruler feature in the Defect Map window. ");
MGCAddSnippet(77, "You can use the Demarcate Repeats feature in the Defect Map window to distinguish defects with different repeat counts across inspections from same mask. By default, this feature is enabled.");
MGCAddSnippet(78, "You can use a demarcation feature in the Defect Map window to distinguish between defects from different inspections.");
MGCAddSnippet(79, "Show Capture Rate mode allows you to find the number of inspections in which the defects have been captured for a particular defect location. ");
MGCAddSnippet(80, "You can use the highlighting feature in the Defect Map window to distinguish between defects detected in different comparison types.");
MGCAddSnippet(81, "You can use Calibre DefectReview to detect the grid on any inspection and perform a number of grid display- specific operations on the Defect Map.");
MGCAddSnippet(82, "A number of defect-specific operations appear when you right-click on a specific defect in the Defect Map window.");
MGCAddSnippet(83, "This section describes many of the general operations that can be performed on any defect (isolated or clustered) in the Defect Map window.");
MGCAddSnippet(84, "Defects can be grouped in clusters using Utilities > Auto Cluster in the Calibre DefectReview menu bar. There are a number of operations available in the Defect Map window.");
MGCAddSnippet(85, "You can add or remove defects from the grid displayed in the Defect Map window.");
MGCAddSnippet(86, "Information about a defect can be viewed using a tool tip. This section describes the different types of tool tips available in the Defect Map window. To view information on multiple defects simultaneously, click the Show Classification Labels button.");
MGCAddSnippet(87, "In the Defect Map window, you can view the tool tip on any defect by placing the cursor on that defect. An arrow is shown with the tool tip initially.");
MGCAddSnippet(88, "You can view the X and Y coordinates at any point in the Defect Map window. ");
MGCAddSnippet(89, "You can navigate to a defect by using GoTo XY or by left-clicking a defect. This section describes both methods.");
MGCAddSnippet(90, "Use the GoToXY dialog box to navigate to a defect using its system coordinates.");
MGCAddSnippet(91, "You can navigate to any defect by clicking on that defect. ");
MGCAddSnippet(92, "Colors assigned to defects of different comparison types can be configured through the dat-ini.xml file.");
MGCAddSnippet(93, "There are a number of factors to keep in mind when using the Defect Map window.");
MGCAddSnippet(94, "The Defect List window provides a table view of all defects found during an inspection. It also provides controls to navigate and edit your defects from the inspection. ");
MGCAddSnippet(95, "The Defect List window contains a number of attributes pertaining to defects generated from inspections. Each defect appears as a single row with each attribute in a column. A few attributes are hidden by default. ");
MGCAddSnippet(96, "You can perform a number of different operations on defects in the Defect List window. The available operations can be accessed from a popup menu that appears when you right-click any row heading.");
MGCAddSnippet(97, "You can select one or more defects to perform operations on.");
MGCAddSnippet(98, "There are a number of general operations that can be performed from a popup menu in the Defect List.");
MGCAddSnippet(99, "In the Defect List window, you can track defects across inspections from a mask, in the Defect List window.");
MGCAddSnippet(100, "There are a number of cluster-specific operations that can be performed on defects in the Defect List.");
MGCAddSnippet(101, "Various operations can be performed on attributes using the Defect List. ");
MGCAddSnippet(102, "You can sort the Defect List based on any of the listed attributes. ");
MGCAddSnippet(103, "Defect report files may sometimes contain a set of defects having, or not having, associated images. The Defect List window enables you to sort and group these defects based on the presence or lack of associated images.");
MGCAddSnippet(104, "In the Defect List, certain pairs of columns can be sorted simultaneously. In this case, the first column is considered as the primary column for sorting purposes. Once the first column is sorted, sorting is applied to the second column automatically.");
MGCAddSnippet(105, "To perform operations on the defect attributes, right-click on any column header in the Defect List to access a popup menu.");
MGCAddSnippet(106, "The Linear Regression Graph between the values of two Defect List columns provides options to compute and view the regression line on the plotted graph. ");
MGCAddSnippet(107, "A number of additional operations can be performed on the ClusterId attribute. These options can be accessed from the popup menu that appears when you right-click the ClusterId attribute. ");
MGCAddSnippet(108, "There are a number of operations that can be performed from a popup menu in the Defect Correlation List.");
MGCAddSnippet(109, "You can navigate to any defect by clicking on any row header or by double-clicking any cell. It becomes the current defect and all information about the current defect is also updated in other windows, such as Image Measurement Unit, Defect Map, and so on.");
MGCAddSnippet(110, "You can copy and paste content from the Defect List window to spreadsheet programs.");
MGCAddSnippet(111, "You can configure Defect List columns using the dat-ini.xml file. ");
MGCAddSnippet(112, "Whenever you add a secondary classification table in Defect Classification, a corresponding secondary classification column must be displayed in the Defect List. To display the corresponding secondary classification column, you must configure the dat-ini.xml file. ");
MGCAddSnippet(113, "Use the Classification History column to track all classification changes for a defect. Whenever you classify any defect, the Classification History column records all classification changes in a predefined order. ");
MGCAddSnippet(114, "The Defect List can be configured by changing the visibility status of each column in the dat-ini.xml file. ");
MGCAddSnippet(115, "Defect Selection displays the defect attributes based on what you select for analysis.");
MGCAddSnippet(116, "The Defect Selection window allows you to select a subset of defects from the input defect data.");
MGCAddSnippet(117, "The basic selection attributes include Defect Size, Defect Code, and so on, for which the values are known or defined.");
MGCAddSnippet(118, "The advanced selection attributes include Defect Location and so on, for which values can be entered as a series of ranges or rectangles.");
MGCAddSnippet(119, "The quick filter attributes includes only Defect ID(s). It is used to quickly select defects based upon defect IDs.");
MGCAddSnippet(120, "Expression-based selectors are used to create customized or user-defined selectors. ");
MGCAddSnippet(121, "You can create expression-based or user-defined selectors through the Calibre DefectReview GUI.");
MGCAddSnippet(122, "There are a number of rules to apply when creating user-defined selectors.");
MGCAddSnippet(123, "The Help button in the User-Defined Selector pane is available to provide a quick overview about the rules.");
MGCAddSnippet(124, "User-defined selectors can combine supported operators and operands following some grammar rules. Operands are the selectors of Calibre DefectReview.");
MGCAddSnippet(125, "Use the User-Defined Selector pane to create a new selector, defining the operators and the operands to be used. ");
MGCAddSnippet(126, "Use the Classification Filter Table in the Defect Selection window to group defects into multiple bins based on defect classifications.");
MGCAddSnippet(127, "The Defect Classification window allows you to classify a defect or a set of defects. ");
MGCAddSnippet(128, "The Defect Classification window contains controls to classify defects generated from a mask inspection. ");
MGCAddSnippet(129, "There are a number of operations related to classifying defects that are supported in the Defect Classification window.");
MGCAddSnippet(130, "Use the Defect Classification window to classify a defect.");
MGCAddSnippet(131, "You can specify the name displayed for the Primary Classification table in the dat-ini.xml file, using the tableName attribute in the classificationTable node.");
MGCAddSnippet(132, "Multitier classification provides the flexibility to add more than one classification type per defect.");
MGCAddSnippet(133, "To use multitier classification, add a node named  SecondaryClassifications  under the datInfo node in the dat-ini.xml file. Within the SecondaryClassifications node, add classificationTable nodes as needed.");
MGCAddSnippet(134, "The Defect Classification window displays all secondary classification tables inserted in the dat-ini.xml file as tabs.");
MGCAddSnippet(135, "For each defect, by default, the secondary classifications are shown in the Defect List window. The secondary classifications are blank if they are not set for the defect. Each of the secondary classification tables is listed in a separate column in the Defect List window. Comments are also added as separate columns for each of the classification types.");
MGCAddSnippet(136, "To confirm the existing classification of a single defect or set of defects after selecting the defects from the Defect List or Defect Map, click the Confirm button in the Defect Classification window. ");
MGCAddSnippet(137, "You can edit comments of a single defect or set of defects after selecting the defects from the Defect List or the Defect Map.");
MGCAddSnippet(138, "Defects can be classified based on size. In this case, the Area parameter present in the inspection file is used to determine the size of the defect. ");
MGCAddSnippet(139, "You can add defect codes through the dat-ini.xml file using the classCodeUnion and higherPriorityToDatIni attributes. ");
MGCAddSnippet(140, "If you open multiple files (using File > Open or Add Inspection), if there is any conflict with a defect type for the same defect code in a classification table (primary and secondary), then Calibre DefectReview prompts you to either resolve the conflict or cancel the loading of the conflicting inspection file. ");
MGCAddSnippet(141, "You can track all classifications of each defect. Once you classify a defect, it will be tracked and will be shown as part of classification history in the Defect List.");
MGCAddSnippet(142, "By default, an inspection machine reports a particular classification code during inspection. This is the first level of reporting of a defect with some classification. However, the report may not be correct or be empty. This typically requires an additional review. If the classification is found to be incorrect, it is reclassified according to the severity of the defect. To track classification changes for these operations, Calibre DefectReview supports defect reclassification.");
MGCAddSnippet(143, "A mask is used multiple times for several IC (integrated circuit) fabrications with same circuit. During its lifetime, a mask is inspected for defects at regular interval. The Repeatability Analysis capability in Calibre DefectReview provides analysis results among successive inspection reports, such as information about added defects or changes in defect size. ");
MGCAddSnippet(144, "You can select different analyses to perform on one or more inspection files in the Repeatability Analysis window. ");
MGCAddSnippet(145, "There are a number of different types of analyses that can be performed on an inspection. These types can be selected from the Analysis Types area in the Repeatability Analysis window. When you perform an analysis, the results appear in the Results Viewing Area.");
MGCAddSnippet(146, "There are a number of operations relating to setting parameters for Repeatability Analysis supported in Calibre DefectReview.");
MGCAddSnippet(147, "You can set or modify particular parameters for each analysis to be performed on an inspection file. This is done primarily through the Parameters dialog box, accessed by clicking the Set Params button in the Computation area of the Repeatability Analysis window.");
MGCAddSnippet(148, "To plot the detection line graph, you must either use auto grid detection or the grid obtained through a Must Catch Defects file. ");
MGCAddSnippet(149, "Before computing the Repeatability Analysis results, you can compute the shift in all inspections with respect to the reference inspection. ");
MGCAddSnippet(150, "When the Calibre DefectReview tool is invoked, a computation for Repeatability Analysis is automatically performed by default.");
MGCAddSnippet(151, "The Results Viewing Area of the Repeatability Analysis window allows you to view analysis results (based on your selection in the Analysis Types pane) either as a graph or a table.");
MGCAddSnippet(152, "You can view analysis results as a graph in the Results Viewing Area.");
MGCAddSnippet(153, "You can view analysis results as a table in the Results Viewing Area.");
MGCAddSnippet(154, "Detection line analysis helps verify the detection capability of a mask inspection system on test masks. Each square (a grid point in the test mask) in the mosaic graph shows the capture rate of a given defect of a particular size. The row in the mosaic represents different defect types and the column represents defect sizes.");
MGCAddSnippet(155, "You can generate a detection line plot from the Repeatability Analysis window. ");
MGCAddSnippet(156, "Overlaying a detection line helps in distinguishing Real defects from Non-Real defects shown in the grid. Non-Real defects are not enclosed by the overlaid detection line.");
MGCAddSnippet(157, "You can reverse the order of defect type labels or defect size labels on detection line graph.");
MGCAddSnippet(158, "You can move the detection line in the right or left direction as well as top to bottom.");
MGCAddSnippet(159, "You can export a detection line grid to a CSV file. ");
MGCAddSnippet(160, "RubberBand mode allows selection of defects using mouse and performing editing operations on the selected defects or locations. You can highlight which defects are selected using RubberBand mode.");
MGCAddSnippet(161, "You can delete defects from the grid by selecting Delete from the right-click menu in a detection line graph. ");
MGCAddSnippet(162, "You can change the defect status from a detection line graph.");
MGCAddSnippet(163, "Use the mouse to zoom in or zoom out to specific regions of the detection line graph. ");
MGCAddSnippet(164, "You can use a Must Catch Defects file to find the capture rate.");
MGCAddSnippet(165, "For a detection line graph, the analysis uses the Must Catch file as reference inspection and the results are shown in a bar chart with four bars.");
MGCAddSnippet(166, "You can save and print the table(s) and graph of an analysis result in the Repeatability Analysis window.");
MGCAddSnippet(167, "You can save the table(s) of a single analysis or all analysis results into a CSV file. ");
MGCAddSnippet(168, "You can save or print the graph of an analysis result into an image file in PNG format. ");
MGCAddSnippet(169, "You can automatically load reference inspections by configuring data in the dat-ini.xml file.");
MGCAddSnippet(170, "The Image Measurement Unit (IMU) window displays defect images and provides tools to perform image processing operations on these images.");
MGCAddSnippet(171, "The Image Measurement Unit (IMU) window consists of display units, where each display unit displays an image or the Cross Section Analysis results. In addition to the display unit area, the IMU window has a tool bar and status bar area.");
MGCAddSnippet(172, "Image Measurement works in two modes, Fixed Mode and Free Mode. These modes can be selected from a dropdown list on the left side of the Image Measurement Unit window toolbar.");
MGCAddSnippet(173, "Individual display units are shown in a grid in the IMU window. The number of rows and columns displayed in the IMU window can be reconfigured through the EDIT button located in the IMU window toolbar.");
MGCAddSnippet(174, "You can configure image type names in the image grid display. Once you have changed the name, all modalities are updated to display the new name. ");
MGCAddSnippet(175, "You can specify the type of the image or cross section results to be displayed in any display unit through a menu available from the header of the individual display units.");
MGCAddSnippet(176, "A number of different types of images can be shown in a display unit in the IMU window.");
MGCAddSnippet(177, "By default, the defect image and reference image of the current defect is displayed in the IMU window. Defect or reference images can be selected from the Defect Images option in the right-click display unit header menu. The layout of the IMU window updates with the image that is selected for the display unit. ");
MGCAddSnippet(178, "Functional images are the output of different operations between images displayed in Calibre DefectReview. These images help in highlighting defects.");
MGCAddSnippet(179, "A signed difference image displays the absolute difference between defect and reference which helps the user to easily identify the polarity (dark or clear) of the defect. ");
MGCAddSnippet(180, "The Zoomed Images (ZI) display adds more images to the defect and reference images in the IMU window. These images are used to better identify defects. Zoomed Images can be selected in the ZI Images option in the right-click display unit header menu.");
MGCAddSnippet(181, "If any auxiliary images such as external images, plug-in images, or layout images are added to a defect in Calibre DefectReview, these images can be selected using the Other Images option from the right-click header menu of the display unit.");
MGCAddSnippet(182, "Cross section analysis results can be configured to be displayed in any of the display units. To see the cross section results, select a display unit and then select the CrossSection option from the right click menu in the header of display unit .");
MGCAddSnippet(183, "The Defect Information table contains a description of defect properties and can be configured to be displayed in any display unit. ");
MGCAddSnippet(184, "The layout that is configured for each of the display units in the IMU can be saved. ");
MGCAddSnippet(185, "Most of the primary operations you can perform in the IMU window can be accessed from a right-click menu in any image display unit.");
MGCAddSnippet(186, "You can zoom in on an image for greater detail using options available in the IMU toolbar.");
MGCAddSnippet(187, "Functional images can be created and displayed in the IMU window. New functional images can be created by specifying operations or functions between images. ");
MGCAddSnippet(188, "When the inspection tool cannot place the defect in the defect die image correctly, you can correct the placement of the defect from reference die to the correct defect die using Calibre DefectReview in TransRef modality. You can manually swap the defects in the upper or lower dies in an IMU window.");
MGCAddSnippet(189, "You can specify a new color scheme to apply to colored images (when you select the Colored option from the right-click menu of an image display) in Calibre DefectReview. The Colored option applies the selected color scheme to the Defect image, Reference image, and so on in the layout based on the image type. ");
MGCAddSnippet(190, "In addition to predefined colormaps such as JET and HSV for displaying color images in the IMU, you can specify your own colormaps in a colormap file. ");
MGCAddSnippet(191, "Ruler is provided in Image Measurement to measure the distance between two points on the images. ");
MGCAddSnippet(192, "The measurement location can be viewed on the defect and reference images using the Display Measurement feature.");
MGCAddSnippet(193, "A gray level matrix of a grayscale image is a 2D array of image pixels  intensities across its length and width. The pixel intensities are indicative of image texture. You can view, overlay, or save gray level matrices in the IMU window. ");
MGCAddSnippet(194, "You can view the gray level values in a table by selecting the GL Matrix > Show option from a right-click menu.");
MGCAddSnippet(195, "You can find the intensity value per pixel of an image in the Image Measurement window by overlaying gray level values onto that image.");
MGCAddSnippet(196, "The GL Matrix can be saved to a CSV file by selecting the GL Matrix > Save option from a right-click menu.");
MGCAddSnippet(197, "You can perform a cross-sectional analysis in the specified area of any image in the Image Measurement window. The results are plotted in a graph with gray level (GL) values compared against the pixel locations in the selected area of the image.");
MGCAddSnippet(198, "When cross section analysis is performed, a cross section bar is drawn to indicate the analysis region. The cross section bar appears as an arrow within a bounding box (click the Display Cross Section Bar icon in the Image Measurement button bar if it is not displayed). ");
MGCAddSnippet(199, "You can modify the default size of the cross section bar in the dat-ini.xml file. You can enter the width and height of the cross section bar in the DefaultCsbWidth and DefaultCsbHeight nodes respectively.");
MGCAddSnippet(200, "You can rotate the position of a cross section bar by selecting options from a right-click menu on the bar itself.");
MGCAddSnippet(201, "The CrossSection window is docked to the IMU window by default and displays only the graph while docked. When undocked, the CrossSection window becomes the GL Vs Pixel window and displays more details.");
MGCAddSnippet(202, "The Cross Section Table displays information about the Cross Section lines that are plotted on the Cross Section plot.");
MGCAddSnippet(203, "You can display or hide the Show GL Vs Pixel Chart button using the ShowGLVsPixelChartButton node in the dat-ini.xml file.");
MGCAddSnippet(204, "You can perform Cross Section Analysis from the IMU window. Cross Section Analysis behaves slightly differently between Fixed Mode and Free Mode.");
MGCAddSnippet(205, "For Fixed Mode, when performing Cross Section Analysis in Fixed Mode, you must first configure the images using the Cross Section Enabler. The Cross Section Enabler is not available in Free Mode.");
MGCAddSnippet(206, "Perform the analysis by using the cross section bar.");
MGCAddSnippet(207, "CD Measurement computes the critical dimension on any pattern on the image. CD Measurement measures the dimension of the pattern on the image with respect to a gray level value. CD analysis computes the distance between the two pixels with the same gray level value on the pattern.");
MGCAddSnippet(208, "CD Measurement works along with Cross Section Analysis in the IMU window. ");
MGCAddSnippet(209, "Calibre DefectReview computes the Target CD and Gray Level (GL) using different methods that you can specify.");
MGCAddSnippet(210, "The CD Measurement Results section of the GL Vs Pixel window is a report that displays the inputs specified for CD analysis as well as the results.");
MGCAddSnippet(211, "Contact Measurement measures the area of contact present on the images.");
MGCAddSnippet(212, "To measure the area of contact on an image, use the Display Contact Measurement Bar button on the IMU window toolbar.");
MGCAddSnippet(213, "The Contact Measurement Report dialog box displays the results of a Contact Measurement operation.");
MGCAddSnippet(214, "Use the Flux Area option in the Image Measurement window to measure the flux area ratio between transmitted defect and reference images.");
MGCAddSnippet(215, "You can select images for flux area ratio calculation by using the Select Images for Flux Area button in the Image Measurement window.");
MGCAddSnippet(216, "Defect Contour shows the contour around the defective region on the images.");
MGCAddSnippet(217, "Defect parts information is a combination of detected lines from each inspection algorithm, capturing the details of locations inspected by an inspection machine. Defect parts are drawn as closed contour paths near to defect regions. These lines are described as the offset from the Defect Reference Pixel and are detected by inspection machines using algorithms. During inspection time, all necessary information is captured in a file called <IR_NAME>_Defects.ini. When loading an inspection report, if this optional file is present, Calibre DefectReview reads it and populates the information in the IMU. You can then display defect parts information in the IMU.");
MGCAddSnippet(218, "A number of properties for the Image Measurement Unit window can be set from the Settings menu in the Calibre DefectReview window.");
MGCAddSnippet(219, "The binary image view for any image needs a gray level threshold value. ");
MGCAddSnippet(220, "To measure the CD variation for any defect, you can either set the target CD value or the threshold GL value. ");
MGCAddSnippet(221, "To perform contact measurement analysis, you have to set one of three properties: GL (0-255), Diameters of the contact, or Area of the contact.");
MGCAddSnippet(222, "An image interpolation property is used to set the interpolation ratio to be used while displaying interpolated images in the Image Measurement Unit window. ");
MGCAddSnippet(223, "An image window property is used to set the window to be displayed while displaying interpolated images (defect window is interpolated in zoomed images) in the Image Measurement Unit window. ");
MGCAddSnippet(224, "You can specify a new color scheme to apply to colored images from the Settings menu in Calibre DefectReview.");
MGCAddSnippet(225, "Calibre DefectReview can output a number of different reports to help you analyze the results of inspections.");
MGCAddSnippet(226, "The Inspection Review Reports window is the primary interface to display reports, allowing you to select different report types to generate and display, as well as the ability to save or print the results.");
MGCAddSnippet(227, "The Defect List report displays the system coordinates, Classification Type, Defect Size (for example, Small, Medium, Large, Xlarge), and so on for each defect in the inspection file.  You can configure what is displayed on the Defect List report by clicking the Configure button to invoke the Configure Report dialog box and selecting the Defect List Report tab.");
MGCAddSnippet(228, "The Defect Map Report displays the Defect Map with the scale.");
MGCAddSnippet(229, "The Defect Statistics Report shows a distribution of the defects in terms of the number and percentage of defects by classification type. ");
MGCAddSnippet(230, "You can configure what information is displayed on each of the different reports in the DefectReview Reports window.");
MGCAddSnippet(231, "You can configure the Defect List report and Defect Map report by invoking the Configure Reports dialog box from the Inspection Review Reports window.");
MGCAddSnippet(232, "The reports in Calibre DefectReview can be saved to HTML format.");
MGCAddSnippet(233, "You can configure multiple locations to export your report. You can choose three different locations to save the report file.");
MGCAddSnippet(234, "You can generate a separate Repeatability Analysis report (containing Analysis Statistics, Defect Repetition Histogram, and Throughput) and save it as an HTML file. ");
MGCAddSnippet(235, "A number of utilities are available that provide additional support for all of the primary operations done in the Calibre DefectReview interface.");
MGCAddSnippet(236, "A standalone TIFF file image can be loaded into Calibre DefectReview and viewed as an auxiliary image in the Image Management window. ");
MGCAddSnippet(237, "The Calibration Parameter Editor allows you to modify the default values used by a number of Calibre DefectReview parameters, including search radius, IMU properties, Repeatability Analysis, and so on.");
MGCAddSnippet(238, "You can edit most of the Calibre DefectReview calibration default parameters from the General Settings tab in the Calibration Parameter Editor.");
MGCAddSnippet(239, "Read Write plugins provide an interface to specify the external reader or writer plugins to read and write inspection files in different formats. You can configure Read Write plugins using the Calibre DefectReview interface.");
MGCAddSnippet(240, "The user can record the operations which are performed in Calibre DefectReview for a set of files and play it back through Calibre DefectReview CLI or Calibre DefectReview GUI on any other set of files.");
MGCAddSnippet(241, "You can group defects displayed in the Defect Map into clusters. Clusters can be generated automatically through the Calibre DefectReview interface.");
MGCAddSnippet(242, "You can shrink defects in a cluster to a single defect with the Utilities > Auto Cluster > Shrink option. When applied, the shrink operation filters out all defects from a cluster set except one defect from the each set.");
MGCAddSnippet(243, "Grid detection utility should be typically used on test mask as the defects are laid out on a grid. This utility provides the option to automatically detect the grid in an inspection and display the grid on the Defect Map to the user. Two grid detection options are provided. ");
MGCAddSnippet(244, "You can save the contents of the Defect List into CSV format. ");
MGCAddSnippet(245, "You can save the contents of the Correlation List into CSV format only from the ALL folder");
MGCAddSnippet(246, "You can export an inspection file to a generic format depending upon the file extensions.");
MGCAddSnippet(247, "You can permanently delete all unselected defects from the Calibre DefectReview interface.");
MGCAddSnippet(248, "You can select single defect or a set of defects. The defects can be selected from the Defect Map or Defect List. ");
MGCAddSnippet(249, "Calibre MDPAutoClassify is used to automatically classify defects observed on blank mask substrates. You need a separate license to run it. ");
MGCAddSnippet(250, "Calibre DefectClassify is used to automatically classify defects observed on pattern mask substrates. Calibre DefectClassify requires a separate license.");
MGCAddSnippet(251, "You can copy all auto defect classification results to manual classification columns in Calibre DefectReview. ");
MGCAddSnippet(252, "The Calibre DefectClassify Report is used to analyze the result of Calibre DefectClassify runs on different inspection reports.");
MGCAddSnippet(253, "The dockable window layout of the Calibre DefectReview interface can be reconfigured using different dock settings. These settings can be saved and exported for future use.");
MGCAddSnippet(254, "You can save the current dock layout configuration and reload it back into Calibre DefectReview in a future session.");
MGCAddSnippet(255, "You can use Calibre DefectReview to export the current display layout and import the exported layout into another system. ");
MGCAddSnippet(256, "Layout Import enables you to view layout or mask images corresponding to defects in the reticle. If the reticle is made of multiple layers, then multiple layout images are displayed for each defect. ");
MGCAddSnippet(257, "In this stage, you use Calibre DefectReview to enter parameters for the input layout images to generate databases.");
MGCAddSnippet(258, "A database is generated for input layout images using the Data Preparation dialog box (Layout > Data Preparation).");
MGCAddSnippet(259, "For GDSII and OASIS files, the creation of a database is done locally on the machine where Calibre DefectReview was launched. For MEBES.JOB and MEBES files, database creation is done remotely on a Linux machine.");
MGCAddSnippet(260, "After the data preparation stage, correlation of data is performed. At this point, transformations are applied to a layout file. A reticle is created from the layout file after applying these transformations.");
MGCAddSnippet(261, "Once the data preparation stage is completed, the translation and the rotation values are calculated based on default values provided in the dat-ini.xml file. These values can either be modified directly in the file, or through the Correlation dialog box.");
MGCAddSnippet(262, "After the data preparation and correlation stages, layout images can be generated and displayed for a defect. ");
MGCAddSnippet(263, "Use the cross probing capabilities of Calibre DefectReview to check where defects are located on layout patterns.");
MGCAddSnippet(264, "The transform functionality of Calibre DefectReview enables you to rotate, flip, and translate defect inspection data.");
MGCAddSnippet(265, "You can rotate defect inspection data by 90°, 180° and 270° in Calibre DefectReview.");
MGCAddSnippet(266, "You can flip (reflect) the defect inspection data around the X and Y axes in Calibre DefectReview.");
MGCAddSnippet(267, "You can translate defect inspection data by setting alignment and reference points in X and Y directions in Calibre DefectReview.");
MGCAddSnippet(268, "You can save reference points for translation and reload them at a later time.");
MGCAddSnippet(269, "You can use Calibre DefectReview to align multiple inspection reports related to a specific reticle. ");
MGCAddSnippet(270, "You can specify any inspection as a base for comparison to others. ");
MGCAddSnippet(271, "Mask Inspection data comes from different sources: blank manufacturers, mask houses, wafer and production facilites. The data must pass through different stages of inspection and analysis. The Calibre DefectReview defect database enables you to manage, analyze, and generate all information required to track and manage defects. Once inspections and defect attributes are stored in the database, they can be used for further analysis in the future such as region analysis, defect source analysis, and blank defect transfer analysis. ");
MGCAddSnippet(272, "After you install the MySql database server, you can create databases and users. You will also need to update MySql attributes such as max_allowed_packet and max_questions before you start using the defect database from Calibre DefectReview.");
MGCAddSnippet(273, "You must create a user to run the MySQL database.");
MGCAddSnippet(274, "In order to use a Defect Database in Calibre DefectReview, you must create it first in the MySQL Database Server.");
MGCAddSnippet(275, "You can generate a database for Calibre DefectReview and connect to it through the Database Settings dialog box.");
MGCAddSnippet(276, "There are two MySQL attributes, max_allowed_packet, and max_questions, that you set to use the Defect Database from Calibre DefectReview.");
MGCAddSnippet(277, "Database migration is the process of importing legacy data to a new database format. Typically, the changes are done to support new functionality or to improve tool efficiency. Calibre DefectReview should always use the latest database format updates.");
MGCAddSnippet(278, "Calibre DefectReview supports a defect management interface that enables you to interact with inspections and defects stored in the database management system. A mask is inspected for defects multiple times at regular intervals. Over time, the number of inspections and defects increases, making it difficult to perform defect trend analysis across inspections using a file and disk-based storage system. ");
MGCAddSnippet(279, "The Defect Management Window provides the capability to perform defects trend analysis across inspections. Examples include region analysis, defect source analysis and blank defect transfer analysis.");
MGCAddSnippet(280, "By default, a query is executed on a complete mask and the result may contain a large amount of data to analyze. You can apply filters to the data before query execution to analyze a specific set of inspection data.");
MGCAddSnippet(281, "You can use the Defect Management window to find defects to analyze their attributes in a specified mask region.");
MGCAddSnippet(282, "You can use the Defect Management window to find the defect and the inspection where the defect was first detected.");
MGCAddSnippet(283, "You can use the Defect Management window to find whether a defect from blank inspection is transferred to patterned inspection at later stages of an inspection.");
MGCAddSnippet(284, "You can use Defect Progress Tracking (DPT) to track mask defect properties across inspections to find a substantial deviation in any defect s property. ");
MGCAddSnippet(285, "DPT provides a snapshot of the defect attributes across the multiple inspections during a specified time interval. You can launch the DPT window from the Defect List to review changes of any attribute values across multiple inspections.");
MGCAddSnippet(286, "Using the Custom Query interface, you can define your own query with desired output columns and apply custom filters. This enables you to use any column for output and filters. The custom query results are displayed in tabular format along with charts representing the Defect Map of a defect s system coordinates.");
MGCAddSnippet(287, "If MaskUniqueId is selected as a filter in the Query Filter utility, then it is treated as a special case in a custom query. This is because all related blank and link mask IDs are also considered as mask IDs.");
MGCAddSnippet(288, "Calibre DefectReview supports an interface that enables you to interact with the tool using a command line. Batch scripts can be written in Tcl that can be loaded into Calibre DefectReview through the command line interface.");
MGCAddSnippet(289, "The Calibre DefectReview command line interface (CLI) is invoked from a Windows or Linux command shell.");
MGCAddSnippet(290, "The Calibre DefectReview command line interface executable contains a number of options to run from the command line.  There are two invocation modes. The first mode is the default -m review mode and works with the inspection file. The second mode is the -m pcserver mode. In this case, Calibre DefectReview runs as a server to monitor a particular shared folder for inspection files. It picks the inspection file automatically and runs Calibre DefectClassify on it, saving the result to the database for further analysis. ");
MGCAddSnippet(291, "The Calibre DefectReview command line interface can be configured to run CalibreDefectClassify automatically and save the results to a database. Currently, this is supported only for LRF inspection reports (both lrfX700 and lrfX800 formats are supported).");
MGCAddSnippet(292, "The Calibre DefectReview CLI supports a number of operations that can be scripted or recorded into a Tcl file.");
MGCAddSnippet(293, "Selects defects from the Advanced Selection list in the Defect Selection window.");
MGCAddSnippet(294, "Clusters defects of files currently-loaded in Calibre DefectReview.");
MGCAddSnippet(295, "Selects defects from the Basic Selection list in the Defect Selection window.");
MGCAddSnippet(296, "Sets a specified defect to a classification type.");
MGCAddSnippet(297, "Copies Auto Defect classifications to manual classifications");
MGCAddSnippet(298, "Creates a database in the database server.");
MGCAddSnippet(299, "Deletes all defects which are not selected for analysis.");
MGCAddSnippet(300, "Detects a grid on an inspection in the specified direction. ");
MGCAddSnippet(301, "Retrieves a unique mask ID from the defect database for an inspection file.");
MGCAddSnippet(302, "Extracts mask unique ID from an inspection file.");
MGCAddSnippet(303, "Performs image to layout alignment.");
MGCAddSnippet(304, "Classifies all specified defects detected after performing Repeatability Analysis.");
MGCAddSnippet(305, "Performs Repeatability Analysis (RA) on the opened inspection files.");
MGCAddSnippet(306, "Deletes all specified defects detected after performing Repeatability Analysis (RA).");
MGCAddSnippet(307, "Saves the Repeatability Analysis results of a specified inspection and analysis type to a specified format.");
MGCAddSnippet(308, "Enables Advanced Selection defects to be entered in as ranges.");
MGCAddSnippet(309, "Enables Advanced Selection defects to be entered in as rectangles.");
MGCAddSnippet(310, "Saves an inspection file opened in Calibre DefectReview.");
MGCAddSnippet(311, "Saves all opened inspection files in Calibre DefectReview.");
MGCAddSnippet(312, "Saves a inspection file opened in Calibre DefectReview to a new filename.");
MGCAddSnippet(313, "Saves an inspection database to a file.");
MGCAddSnippet(314, "Saves information displayed in the Defect List in CSV format. ");
MGCAddSnippet(315, "Saves inspection file(s) opened in Calibre DefectReview to the Defect Database. ");
MGCAddSnippet(316, "Saves selected reports of the specified inspection to a single consolidated HTML report file.");
MGCAddSnippet(317, "Saves the Reticle Information File (RIF) to a defect database.");
MGCAddSnippet(318, "Select defects to be used for analysis. ");
MGCAddSnippet(319, "Sets a user name and password for running CLI commands related to the defect database.");
MGCAddSnippet(320, "Translates the inspection with X and Y coordinates.");
MGCAddSnippet(321, "Wi2Mi is the Calibre DefectReview Wafer Inspection to Mask Inspection defect analysis tool. It maps wafer defects to the mask field cycle. ");
MGCAddSnippet(322, "The Wi2Mi tool is a separate program that runs independently of Calibre DefectReview. It can be run interactively in a GUI or from a command line. ");
MGCAddSnippet(323, "As specified for Calibre DefectReview, three user permission levels (Privileged, Normal, and Restricted) are supported for Wi2Mi. The three user permission levels differ in the features available to them. Privileged users have access to all features of Wi2Mi.");
MGCAddSnippet(324, "The Wi2Mi tool helps analyze and compare the mask and wafer inspection data. The reticle data is printed on a wafer in a step-and-repeat method. A wafer is placed on a stage and is exposed to the mask data upon each unit displacement. To compare the mask data with the corresponding wafer data, the wafer needs to be folded. In Wi2Mi folding of wafer data such that the folded wafer pattern matches the mask field is known as  stacking. ");
MGCAddSnippet(325, "Stacked wafer data may not correlate to the mask data. When this occurs, you may need to transform the mask data using operations such as reflection (flipping), rotation, and translation in order to align the mask and wafer data.");
MGCAddSnippet(326, "The Wi2Mi defect analysis tool uses some of the same window names as the main Calibre DefectReview interface. However, the functionality is not identical.");
MGCAddSnippet(327, "The Wi2Mi interface is organized into several key functional regions. These regions do not appear until after a wafer or mask inspection file has been loaded.");
MGCAddSnippet(328, "The Wi2Mi Alignment dialog box allows you to adjust the overlay between mask and wafer inspection data.");
MGCAddSnippet(329, "The Wi2Mi Defect Map provides a graphical view of both the mask and wafer defects. It also lets you navigate and edit defects.");
MGCAddSnippet(330, "The Defect List provides a table view of all the defects. The Defect List table has both mask and wafer defects listed.");
MGCAddSnippet(331, "The WiMi Defect Classification window provides an interface for classifying mask and wafer defects.");
MGCAddSnippet(332, "The Wi2Mi wafer map provides another graphical view of all the wafer defects and mask defects.");
MGCAddSnippet(333, "Repeatability Analysis in Wi2Mi provides analysis results among successive inspection reports, such as information detailing the number of added, common and missing defects between the mask and the wafer inspection.");
MGCAddSnippet(334, "Repeatability Analysis is performed across mask and wafer inspection data. The reference inspection in Wi2Mi is always the mask inspection file.");
MGCAddSnippet(335, "The Repeatability Analysis window displays a bar graph that details the number of added, common and missing defects between the mask and the wafer inspection.");
MGCAddSnippet(336, "The Wafer Defect Management tool in Calibre DefectReview is used to open and inspect a wafer file, supporting a number of utilities to assist in analyzing wafer files.");
MGCAddSnippet(337, "The Wafer Defect Management tool is a separate program that runs independently of Calibre DefectReview. It can be run interactively in a GUI.");
MGCAddSnippet(338, "The Wafer Defect Management tool uses some of the same window names as the main Calibre DefectReview interface. However, some of the functionality is not identical.");
MGCAddSnippet(339, "The Wafer Defect Management window is organized into several key functional regions.");
MGCAddSnippet(340, "The Wafer Defect Management wafer map provides another graphical view of all the wafer defects.");
MGCAddSnippet(341, "You can color the dies on a wafer to indicate status using the Wafer Map.");
MGCAddSnippet(342, "You can change a die s color by manually classifying the die in the Wafer Map.");
MGCAddSnippet(343, "The Defect List provides a table view of all the defects. It shows wafer defects with all its attributes.");
MGCAddSnippet(344, "Once you have successfully loaded a wafer file, you can align SEM images with layout images. This is performed with the Calibre DefectClassify tool.");
MGCAddSnippet(345, "DFM Data Analysis (DFDMA) is a method of pattern classification used to assist wafer defect analysis by applying various clustering and classification techniques to defect information obtained from wafer inspections. The DFMDA output can be read by the Wafer Defect Management tool by clicking the DFMDA icon in the toolbar. ");
MGCAddSnippet(346, "You can run a simple Design Rule Check (DRC) from the Wafer Defect Management tool using a basic interface (a subset of features from CalibreInteractive nmDRC).");
MGCAddSnippet(347, "In Wafer Defect review, you can group defects based on the similarity of patterns they land into the design. If multiple defects have similar patterns, they can be grouped together or classified as defects affected by similar patterns.");
MGCAddSnippet(348, "You can use Calibre DefectReview to cross-probe a wafer defect to schematic nets in a schematic viewer, allowing you to locate nets impacted by the defect. Similarly, defects can be cross-probed to schematic and layout viewers for the DC Fail Analysis (highlighting power nets in schematic and layout viewers).");
MGCAddSnippet(349, "This appendix contains brief answers to commonly or frequently asked questions (FAQ) and also provides links to corresponding detailed information in this manual.");
MGCAddSnippet(350, "There are two tasks involved in setting up a PRO floating license: setting up the license server and setting the LM_LICENSE_FILE environment variable.");
MGCAddSnippet(351, "Calibre DefectReview software requires the VC runtime redistributable software (Visual C++ Redistributable for Visual Studio 2015) and the MATLAB compiler runtime (MCR - Matlab Compiler Runtime v2015).");
MGCAddSnippet(352, "When installing the MATLAB compiler runtime (MCR), an error message may appear when the VC redistributable is not installed. Try installing the VC redistributable, located in C:\\DefectAnalysisTool\\VC_runtime_redistributables\\vcredist_x86.exe, and then attempt to install MCR again.");
MGCAddSnippet(353, "The IMU provides functional images for absolute difference, average, blinking, and sum. New functional images are created by specifying operations between images, usually the reference image and a defect image.");
MGCAddSnippet(354, "The IMU grid layout is the two-dimensional array in which the display units (images and cross-section results) are arranged. The change only persists through the session unless you save the dock layout.");
MGCAddSnippet(355, "The initial image size in the Calibre DefectReview IMU is set in the Calibration Parameter Editor.");
MGCAddSnippet(356, "Calibre DefectReview can automatically classify defects based on the size as reported by the mask inspection machine. However, it cannot represent different defect sizes with different colors or be configured to give a warning message on large defects.");
MGCAddSnippet(357, "The Calibre DefectReview main window contains a number of functional regions for defect analysis and classification.");
MGCAddSnippet(358, "The Calibre DefectReview interface is organized into several dockable and resizable sub-windows, each with key functionality.");
MGCAddSnippet(359, "");
MGCAddSnippet(360, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

